INSERT INTO `articolo` (`id`, `data`, `titolo`, `testo`, `name`, `image`) VALUES
(1, '2019-10-18', 'Amazzonia sta bruciando', 'Fiamme appiccate con intenzione, che aumentano la deforestazione e mettono a rischio la biodiversitÃ  della foresta e le popolazioni che vi abitano.Per mesi, sin dal suo insediamento, il presidente brasiliano Jair Bolsonaro e i suoi ministri hanno rivendicato sovranitÃ  assoluta sulla foresta amazzonica. Prima criticando le politiche adottate a tutela della foresta pluviale e dei popoli indigeni, identificandole come freno allo sviluppo e annunciando nuove concessioni per lo sfruttamento di suolo e sottosuolo. Poi lanciando strali contro le ong e indebolendo tutte le agenzie governative incaricate della difesa della foresta. Infine, screditando l Istituto nazionale di ricerca spaziale (Inpe) e licenziandone il direttore, reo di aver divulgato i dati allarmanti della deforestazione senza il previo permesso del presidente.', 'fogo.jpg', );
INSERT INTO `articolo` (`id`, `data`, `titolo`, `testo`, `name`, `image`) VALUES
(3, '2019-11-22', 'Giovane muore attacato da uno squalo in Nordeste del Brasile', 'Il giovane che Ã¨ stato attaccato da uno squalo sulla spiaggia Piedade a Recife,  Ã© morto presso l Ospedale di Restauro (HR), Derby, nella zona centrale di Pernambuco. Jose Ernesto Ferreira da Silva ha subito un intervento chirurgico ma non ha potuto resistere alle sue ferite. Otto chirurghi sottoposti a chirurgia per l amputazione della gamba sinistra e la rivascolarizzazione genitale. E arrivato privo di sensi con una ferita estremamente estesa e molto grave. Dopo l intervento chirurgico, ha avuto uno shock ipovolemico [grande perdita di sangue che colpisce il pompaggio di sangue attraverso il cuore] e non ha resistito , ha detto il medico di turno.La morte Ã© avvenuta alle 4:05. Il corpo di JosÃƒÂ© Ernesto fu inviato all Istituto di medicina legale (IML), dove subÃƒÂ¬ una necroscopia. In questo caso, dovrebbe arrivare a 65 o il numero ufficiale di attacchi e a 25 il numero di decessi nell elenco del Comitato di monitoraggio degli incidenti dello squalo di Stato (Cemit), che ha registrato casi dal 1992 a Pernambuco.', 'morte.jpg', );
INSERT INTO `articolo` (`id`, `data`, `titolo`, `testo`, `name`, `image`) VALUES
(4, '2019-11-25', 'Allerta Rossa della Protezione Civile in Emilia-Romagna', 'Eâ€™ stata riaperta in mattinata, a una sola corsia per senso di marcia, lâ€™A21 Torino-Piacenza, chiusa ieri sera tra Asti e Villanova per lâ€™apertura di una voragine causata dalle forti piogge. Dalle dieci di stamane il ritorno alla normalitÃ .\r\n\r\nLe scuole superiori di Asti rimangono chiuse su decisione del sindaco Maurizio Rasero in conseguenza del blocco parziale dell\'autostrada e delle prevedibili ripercussioni sul traffico in cittÃ . La situazione Ã¨ ancora difficile anche in provincia di Cuneo, con numerose provinciali chiuse al transito per allagamenti. Ha invece riaperto il tratto dell\'autostrada A5, tra Ivrea e Pont-Saint-Martin in Valle Dâ€™Aosta, che era stato chiuso sabato scorso per la frana in localitÃ  Chiappetti a Quincinetto. Resta invece interrotta nelle due direzioni la A6 Torino-Savona (tra Savona ed Altare verso nord e tra Millesimo e Savona verso sud) dopo il crollo di una pila del viadotto â€œMadonna del Monteâ€, investita ieri pomeriggio da una frana. Desta ancora preoccupazione la Calabria, dove piove ininterrottamente da sabato sera e domenica alcune strade erano state invase dall\'acqua a Reggio e Lamezia Terme (Catanzaro) con gravi allagamenti e disagi.', '', ''),
(9, '2019-11-23', 'Terremoto in Albania: scossa di magnitudo 6.5 al largo di Durazzo, almeno sette morti', 'Una forte scossa di terremoto di magnitudo 6.5 ha colpito alle 2,54 ora locale (le 3,54 in Italia) la costa settentrionale dell\'Albania, vicino a Durazzo. Secondo i dati dell\'Istituto nazionale di geofisica e vulcanologia (Ingv) italiano e del servizio geologico statunitense Usgs, il sisma ha avuto ipocentro a circa dieci chilometri di profonditÃ  ed epicentro tra Shijak e Durazzo. Almeno sette persone hanno perso la vita. Nella capitale, Tirana, la gente Ã¨ scesa in strada in preda al panico, a Durazzo e Thuname crollati case e palazzi, dispersi, almeno 300 feriti, persone sotto le macerie.\r\n\r\n\r\nCRONACA\r\nTerremoto in Albania, la scossa avvertita anche in Campania\r\nDI ANNA LAURA DE ROSA\r\n\r\nUnitÃ  dell\'esercito e della protezione civile sono al lavoro tra le macerie di un palazzo a Durazzo e di altri tre a Thumana, dove sono stati tratti in salvo per ora due bambini. A Kurbin un uomo Ã¨ morto invece dopo essersi gettato dal balcone per tentare di mettersi in salvo.\r\n\r\n\r\n \"E\' stata una scossa forte e lunga, si muoveva tutto. In preda alla paura e al panico siamo corsi in strada\". Questo il racconto di Aida, italiana di origine albanese, da Tirana. \"Qui fortunatamente non ci sono stati danni importanti a differenza di Durazzo e dei paesi vicini dove ci sono stati diversi crolli\", aggiunge. \"Noi siamo al primo piano - racconta Aida che in questi giorni si trova nella capitale albanese in visita alla sua famiglia - e appena sentita la scossa abbiamo preso i miei nipoti di due e sette mesi e siamo andati in strada. E qui restiamo al momento perchÃ© le repliche, seppur piÃ¹ brevi e meno intense, continuano\".\r\n\r\nLe prime immagini dall\'Albania arrivano su Twitter, alcune case completamente crollate.', '', ''),
(11, '2019-11-23', 'Violenze sulle donne registra un omicidio ogni due ore', 'In Brasile la violenza sulle donne Ã© diffusa. Con omicidi, stupri e altri crimini motivati proprio dalla differenza di genere. Dati preoccupanti arrivano dai due piÃ¹ popolosi stati del paese sudamericano, San Paolo e Rio de Janeiro.Nel 2018 il numero di omicidi di donne in Brasile ha diminuito del 6,7% rispetto all anno precedente. Ma i numeri sono preoccupanti: nel paese sudamericano l anno scorso sono state uccise 4.254 donne, una ogni due ore. E i casi di femminicidio , ossia quelli registrati come crimini di odio motivati proprio dalla condizione di genere, sono stati 1.173, contro i 1.047 del 2017.\r\n\r\nNumeri preoccupanti, che si sommano a quelli che arrivano dagli stati di Rio de Janeiro e San Paolo, dove le statistiche mostrano impennate di violenza sessuale e di genere contro le donne.\r\n\r\nI numeri dei femminicidi, raccolti in una ricerca del giornale G1 con il Nucleo di studio della violenza della UniversitÃ  di San Paolo e dal Forum brasiliano di sicurezza pubblica, inoltre, potrebbero essere parziali. Non tutti i dati statistici, infatti, sono registrati allo stesso modo nei singoli stati della federazione brasiliana e non tutti gli stati hanno le stesse capacitÃ Â  o lo stesso interessi nel voler divulgare questi numeri.', '', ''),
(12, '2019-11-27', 'La decisione della Cassazione, Battisti resta allâ€™ergastolo: respinto il ricorso', 'Battisti, condannato per quattro omicidi commessi alla fine degli anni 70, Ã¨ stato arrestato nello scorso gennaio in Bolivia, dopo 37 anni di latitanza.\r\nErgastolo confermato per lâ€™ex terrorista dei Pac Cesare Battisti: la prima sezione penale della Cassazione, dopo la camera di consiglio di ieri, ha dichiarato inammissibile il ricorso presentato dalla difesa contro lâ€™ordinanza con cui, il 17 maggio scorso, la Corte di assise di appello di Milano aveva negato la commutazione della pena dellâ€™ergastolo in quella di trentâ€™anni di reclusione.\r\n\r\nBattisti, condannato per quattro omicidi commessi alla fine degli anni 70, Ã¨ stato arrestato nello scorso gennaio in Bolivia, dopo 37 anni di latitanza, ed Ã¨ detenuto in carcere a Oristano. Le questioni sollevate con il ricorso dalla difesa riguardavano la persistenza dellâ€™efficacia dellâ€™accordo di commutazione della pena che era stato stipulato tra le AutoritÃ  italiane e brasiliane, in vista dellâ€™estradizione dal Brasile ( ma Battisti alla fine venne consegnato allâ€™Italia dalla Bolivia) nonchÃ© la legittimitÃ  della procedura culminata nellâ€™espulsione del condannato dalla Bolivia.\r\n\r\nLa Corte di Cassazione ha dunque ritenuto corretta la decisione della Corte di assise di appello milanese.', '', ''),
(15, '2019-11-26', 'Alzheimer, scoperta molecola che blocca la malattia', 'SCOPERTA dai ricercatori della Fondazione EBRI \'Rita Levi-Montalcini\' una molecola che \'ringiovanisce\' il cervello bloccando l\'Alzheimer nella prima fase: Ã¨ l\'anticorpo A13, che ringiovanisce appunto il cervello favorendo la nascita di nuovi neuroni e contrastando cosÃ¬ i difetti che accompagnano le fasi precoci della malattia.\r\n\r\nLo studio Ã¨ stato effettuato su topi che, cosÃ¬ trattati, hanno ripreso a produrre neuroni a un livello quasi normale. Una strategia, secondo i ricercatori, che apre nuove possibilitÃ  di diagnosi e cura. Fermo restando che per i test sull\'uomo \"ci vorrÃ  ancora qualche anno e bisognerÃ  prima valutare gli esiti delle fasi pre-cliniche di sperimentazione\".', '', '');

